import React from 'react';
import * as S from './Loading.styled.js'

export default function Loading() {
  return (
    <S.Loading> 
      <div> 
        <S.DotCero/> 
        <S.DotOne/> 
        <S.DotTwo/> 
        <S.DotThree i={3}/> 
        <S.DotFour/> 
      </div>
    </S.Loading>
  )
}
